import {
    FormControlLabel,
    Grid,
    Paper,
    TextField,
    Checkbox,
    Button,
    Typography,
      
  } from "@material-ui/core";
  import "./Login.css";
  import React, { useState} from "react";
  import { Link, Route, Router } from "react-router-dom";
  
  function Login() {
    const paperStyle = {
      padding: 20,
      height: "50vh",
      width: 340,
      margin: "50px auto",
    };
  
    const [credentials, setCredentials] = useState({
      username: [],
      password: [],
    });
  
    const color = "#2e458c";
  
    const buttonStyle = { margin: "7px", backgroundColor: color };
  
    const handleChange = (e) => {
      const {} = e.target.value;
      setCredentials({ ...credentials, [e.target.name]: e.target.value });
    };
  
    const handleSubmit = (e) => {
      e.preventDefault();
  
      //console.log(credentials);
      setCredentials({ email: "", password: "" });
  
  
      
    };
  
    return (
      <Router>
        
          <Route>
                <switch>
                <Grid class="login">
        <Paper elevation={24} style={paperStyle}>
          <Grid align="center">
          <Grid align="center">
          <img src="../images/logo.png"style={{width:220}}/>
              {/*<LockOutlinedIcon size={30}/>*/}
              </Grid>
            
          </Grid>
          <Grid align="center">
            <TextField
              label="Email"
              name="email"
              placeholder="Enter email"
              value={credentials.email}
              onChange={handleChange}
              fullWidth
              required
            />
            <TextField
              label="Password"
              name="password"
              placeholder="Enter Password"
              type="password"
              value={credentials.password}
              onChange={handleChange}
              fullWidth
              required
            />
            <FormControlLabel
              control={<Checkbox name="checkedB" color="primary" />}
              label="Remember Me"
            />
            <Button
              onClick={handleSubmit}
              type="submit"
              style={buttonStyle}
              color="primary"
              variant="contained"
              fullWidth
            >
              Sign In
            </Button>
            <Typography>
               <Link href="#">Forgot Password ?</Link> 
            </Typography>
            <br />
            <br />
            <br />
            <Typography>
               Don't you have an account ?<Link href="#">Sign Up</Link> 
            </Typography>
          </Grid>
        </Paper>
      </Grid>
                </switch>
          </Route>
      
      </Router>
      
    );
  }
  
  export default Login;
